import React from "react";

const Usuarios = () => {
  return (
    <div className="site-card-border-less-wrapper">
    <Card
      title="Usuarios"
      bordered={false}
      style={{ width: FullscreenExitOutlined }}
    >
      
    </Card>
  </div>
  );
};

export default Usuarios;
